import React from "react";


const InformationOfThePatiente = (props) => {
  const { info, show  } = props
  return (
    <div >
        { show ?
        <div className="container divBorder">
        <label>Identity:</label>
        <input defaultValue={info.identity} readOnly></input>
        <label>Name:</label>
        <input defaultValue={info.name} readOnly></input>
        <label>Lastname:</label>
        <input defaultValue={info.lastname} readOnly></input>
        </div>: null}
    </div>
  );
}

export default InformationOfThePatiente;
